import React from 'react'
import './css/Movement.css'

const Movement = (props) => {
    return (
        <div className='movement'>
            <h1 className='type'>{props.type}</h1>
            <img className="image-ingreso"src='img/ingreso-egreso/ingreso.png' alt='img' width="100%" />
            <img className="image-egreso"src='img/ingreso-egreso/egreso.png'  width="100%" />
        </div>
    )
}

export default Movement;
